import { Box } from "@material-ui/core";
import React from "react";
import Header2 from "../../shared/header/Header2";
import Footer from "../../shared/footer/Footer";

const WhatWeDo = () => {
  return (
    <React.Fragment>
      <Box>
        <Header2></Header2>
        <h1>What We Do</h1>
        <Footer></Footer>
      </Box>
    </React.Fragment>
  );
};

export default WhatWeDo;
